\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"3027010","type":"CustomJS"},{"attributes":{"data":{"x":[0,1258]},"selected":{"id":"3026782"},"selection_policy":{"id":"3026781"}},"id":"3026758","type":"ColumnDataSource"},{"attributes":{},"id":"3026782","type":"Selection"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","line_width":1.3,"x":{"field":"index"},"y":{"field":"aberration(H,L,C)_0_4"}},"id":"3026990","type":"Line"},{"attributes":{},"id":"3026705","type":"UnionRenderers"},{"attributes":{"coordinates":null,"data_source":{"id":"3026758"},"glyph":{"id":"3026759"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"3026761"},"nonselection_glyph":{"id":"3026760"},"view":{"id":"3026763"}},"id":"3026762","type":"GlyphRenderer"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"value":0.1},"fill_color":{"field":"inc","transform":{"id":"3026886"}},"hatch_alpha":{"value":0.1},"line
